description:
IMDB score: 7.4


Director: Jim Taihuttu


Maj-id is a talented kick boxer from a gray, anonymous suburb in The Netherlands. As his fighting prowess brings him increasing notoriety in-and outside the ring, the worlds of kickboxing and organized crime begin to blur into each another and Majid begins to lose sight of what it is he really wants.




